import React, { useEffect } from 'react'
import EventImg from '../Image/eventImg.jpeg'
import '../EventPage/Event.css'
import AOS from 'aos';
import 'aos/dist/aos.css';

function Event() {
    useEffect(() => {
        AOS.init();
    }, [])

    return (
        // <div className="EventBox w-full h-fit bg-slate-900 p-10 flex flex-col items-center justify-around">
        //     <h1 className='text-center text-white pt-10'>Event</h1>
        //     {EventData.map((E) => (
        //         <div className="EventContainer w-full h-fit flex align-middle justify-evenly  flex-wrap ">
        //             <div className="eventBoxCard1" data-aos="fade-right">
        //                 <img src={E.EventImg} alt='' className='eventcardImg' />
        //                 <div className="EventContent">
        //                     {E.description}
        //                 </div>
        //             </div>
        //             <div className="eventBoxCard2" data-aos="fade-left">
        //                 <img src={E.EventImg} alt='' className='eventcardImg' />
        //                 <div className="EventContent">
        //                     {E.description}

        //                 </div>
        //             </div>
        //         </div>
        //     ))}
        // </div>
        <>
            <button data-modal-target="default-modal" data-modal-toggle="default-modal" class="block text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 mt focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800" type="button">
                Toggle modal
            </button>


            <div id="default-modal" tabindex="-1" aria-hidden="true" class="hidden overflow-y-auto overflow-x-hidden fixed top-0 right-0 left-0 z-50 justify-center items-center w-full md:inset-0 h-[calc(100%-1rem)] max-h-full">
                <div class="relative p-4 w-full max-w-2xl max-h-full">

                    <div class="relative bg-white rounded-lg shadow dark:bg-gray-700">

                        <div class="flex items-center justify-between p-4 md:p-5 border-b rounded-t dark:border-gray-600">
                            <h3 class="text-xl font-semibold text-gray-900 dark:text-white">
                                Terms of Service
                            </h3>
                            <button type="button" class="text-gray-400 bg-transparent hover:bg-gray-200 hover:text-gray-900 rounded-lg text-sm w-8 h-8 ms-auto inline-flex justify-center items-center dark:hover:bg-gray-600 dark:hover:text-white" data-modal-hide="default-modal">
                                <svg class="w-3 h-3" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 14 14">
                                    <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m1 1 6 6m0 0 6 6M7 7l6-6M7 7l-6 6" />
                                </svg>
                                <span class="sr-only">Close modal</span>
                            </button>
                        </div>

                        <div class="p-4 md:p-5 space-y-4">
                            <p class="text-base leading-relaxed text-gray-500 dark:text-gray-400">
                                With less than a month to go before the European Union enacts new consumer privacy laws for its citizens, companies around the world are updating their terms of service agreements to comply.
                            </p>
                            <p class="text-base leading-relaxed text-gray-500 dark:text-gray-400">
                                The European Union’s General Data Protection Regulation (G.D.P.R.) goes into effect on May 25 and is meant to ensure a common set of data rights in the European Union. It requires organizations to notify users as soon as possible of high-risk data breaches that could personally affect them.
                            </p>
                        </div>
                        <div class="flex items-center p-4 md:p-5 border-t border-gray-200 rounded-b dark:border-gray-600">
                            <button data-modal-hide="default-modal" type="button" class="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">I accept</button>
                            <button data-modal-hide="default-modal" type="button" class="ms-3 text-gray-500 bg-white hover:bg-gray-100 focus:ring-4 focus:outline-none focus:ring-blue-300 rounded-lg border border-gray-200 text-sm font-medium px-5 py-2.5 hover:text-gray-900 focus:z-10 dark:bg-gray-700 dark:text-gray-300 dark:border-gray-500 dark:hover:text-white dark:hover:bg-gray-600 dark:focus:ring-gray-600">Decline</button>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}



export default Event
const EventData = [
    {
        EventImg: EventImg,
        description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Exercitationem facilis, quasi nemo doloremque repellendus, eligendi unde odio harum illum nesciunt eveniet aliquam sint voluptates repudiandae ea cumque ducimus, blanditiis reiciendis.Quis libero ullam obcaecati adipisci modi magnam suscipit necessitatibus corporis alias praesentium ab voluptatibus impedit velit porro officia provident ea, fuga magni harum? Cumque adipisci ex deleniti maiores delectus quo."
